import React from "react";
import profile from "../images/profile.png";
import php from "../images/php-med-trans-light.gif";
import java from "../images/java.png";
import mysql from "../images/mysql.png";
function About(props) {
  return (
    <div className="about mt-5" id="about">
      <h1 style={{ textTransform: "uppercase" }} className="stroke-text">
        {" "}
        <i> About Me</i>
      </h1>
      <div className="d-flex" style={{flexWrap:"wrap"}}>
    
          <div className="col-12 col-lg-6">
            <div
              className={`text-${props.mode === "light" ? "dark" : "light"}`}
            >
              {" "}
              Hello! My name is{" "}
              <strong className="text-info"> Md Shoyeb </strong> and I enjoy
              creating things that live on the internet. My interest in web
              development and coding .
            </div>
            <div
              className={`text-${
                props.mode === "light" ? "dark" : "light"
              } mt-3`}
            >
              Now i am a 3rd year student of Bechelor of Technology in
              Electronics and communication engineering from{" "}
              <strong className="text-info">
                {" "}
                <i> Aliah University</i>
              </strong>{" "}
              and my passing year is 2023. i am looking internship/Job on my
              skill, also my diploma engineering (ECE) is completed from{" "}
              <strong className="text-info"> Jamia Millia Islamia</strong>{" "}
              University in 2020.
            </div>
            <div
              className={`mt-3 text-${
                props.mode === "light" ? "dark" : "light"
              }`}
            >
              I also recently launched a gym app with{" "}
              <strong className="text-info">React js</strong>.
            </div>
          </div>
       
      <div className="pic">
      <div style={{position:"relative"}} className=" mx-5 picture">
              <div className="position-relative " style={{zIndex:"5"}}>  <img className={`shadow bor-radius bg-${props.mode==='light'?"dark":"light"}`}  
                  typeof="image/png"
                  src={profile}
                  style={{ width: "20rem",   zIndex: "1", height: "20rem" }}
                  alt=""
                />{" "}
                </div>
                <div
                  className="empty bor-radius"
                  style={{
                    width: "20rem",
                    height: "20rem",
                    position: "absolute",
                    zIndex: "2",
                    left: "1rem",
                    top: "1rem",
                    border: "2px solid cyan",
                  }}
                ></div>
              </div>
      </div>
      </div>
      <div
        className={`my-4 h-5 text-${props.mode === "light" ? "dark" : "light"}`}
      >
        Here are a few technologies I’ve been working with recently:
      </div>
      <div className=" mt-5 d-flex " style={{ flexWrap: "wrap" }}>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          {" "}
          <img style={{ width: "4rem" }} src={java} alt="" /> Java{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`d-flex text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          {" "}
          <i className="uil uil-navigator"></i> <h5 className="ms-2">  Data <span className="stroke-text"> Structure And </span> Algorithm </h5>{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          {" "}
          <i
            className={`h1 text-${
              props.mode === "light" ? "dark" : "light"
            } uil uil-react`}
          ></i>{" "}
          React js{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          <i
            className={`h1 text-${
              props.mode === "light" ? "dark" : "light"
            } uil uil-html3`}
          ></i>{" "}
          Html{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          {" "}
          <i
            className={`h1 text-${
              props.mode === "light" ? "dark" : "light"
            } uil uil-css3-simple`}
          ></i>{" "}
          Css{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          <i
            className={`h1 text-${
              props.mode === "light" ? "dark" : "light"
            } uil uil-java-script`}
          ></i>{" "}
          JavaScript{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          <img src={php} alt="php" style={{ width: "4rem" }} /> Php{" "}
        </li>
        <li
          style={{ listStyle: "none" }}
          className={`text-${props.mode === "light" ? "dark" : "light"} py-2 px-5`}
        >
          <img src={mysql} alt="php" style={{ width: "4rem" }} />{" "}
        </li>
      </div>
    </div>
  );
}

export default About;
